import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Header from "./components/Header";

function App() {
  return (
    <div className="app">
      <Router>
        <div className="app">
          <Switch>

            <Route path="/">
              <Header/>
            </Route>


          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
